var title_f36_58_37794="Ecological fallacy";
var content_f36_58_37794=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F63627&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F63627&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Ecological fallacy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 523px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Hypothetical relationships between age and treatment effect both within trials (represented by the solid lines) and between trials (represented by the circles, which indicate the study means, and the dashed lines, which indicate the regression lines).",
"    <br>",
"     In the top example, individual studies demonstrate an association between age and treatment effect, but the association appears to be lost when looking only at the mean values across studies. Alternatively, in the bottom example, individual studies demonstrate no association between age and treatment effect. However, possibly due to chance or confounding, an apparent association is seen across the mean values of studies.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Adapted from: Thompson SG, Higgins JPT. How should meta-regression analyses be undertaken and interpreted? Stat Med 2002; 21:1559.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
