"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Alecrim MG, Lacerda MV, Mour&atilde;o MP, et al, &ldquo;Successful Treatment of",
"      <i>",
"       Plasmodium falciparum",
"      </i>",
"      Malaria With a Six-Dose Regimen of Artemether-Lumefantrine Versus Quinine-Doxycycline in the Western Amazon Region of Brazil,&rdquo;",
"      <i>",
"       Am J Trop Med Hyg",
"      </i>",
