var script_f36_58_37805=[""].join("\n");
var outline_f36_58_37805=null;
var title_f36_58_37806="ECX for advanced esophagogastric cancer";
var content_f36_58_37806=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53899&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53899&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Epirubicin, cisplatin, and capecitabine (ECX) for advanced esophagogastric cancer",
"    <sup>",
"     [1,2]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 21 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Epirubicin",
"        </strong>",
"       </td>",
"       <td>",
"        50 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Administer into a free flowing IV solution with normal saline (NS)*, generally over 3 to 20 minutes.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cisplatin",
"        </strong>",
"       </td>",
"       <td>",
"        60 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Dilute with at least 250 mL NS and administer over 120 minutes. Do not administer with aluminum needles or intravenous sets.",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Capecitabine",
"        </strong>",
"       </td>",
"       <td>",
"        625 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        per dose by mouth",
"       </td>",
"       <td>",
"        Twice daily; take with water within 30 minutes after a meal.",
"       </td>",
"       <td>",
"        Days 1 through 21",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Give IV fluid to establish a urine flow of at least 100 mL/hour for at least two hours prior to and two hours after cisplatin administration. Refer to UpToDate topic on \"Cisplatin nephrotoxicity\", section on Prevention.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        Epirubicin plus cisplatin: HIGH. Oral capecitabine alone: LOW. Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        There are no recommended premedications to prevent infusion reactions. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Epirubicin is a vesicant; cisplatin is an irritant but can cause significant tissue damage. Avoid extravasation of either agent. Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with granulocyte colony stimulating factors is not warranted (incidence of febrile neutropenia with ECX was 0 and 7 percent in two trials",
"        <sup>",
"         [1,2]",
"        </sup>",
"        ). Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        The optimal approach to cisplatin therapy in patients with preexisting renal impairment is unknown. In the original ECX protocol, patients were required to have GFR &ge;60 mL/min and a serum creatinine within normal range",
"        <sup>",
"         [2]",
"        </sup>",
"        . Lower starting doses of capecitabine may be needed in patients with renal impairment",
"        <sup>",
"         [3]",
"        </sup>",
"        . Lower starting doses of epirubicin may be needed in patients with preexisting renal or hepatic impairment",
"        <sup>",
"         [4]",
"        </sup>",
"        . Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Cardiac issues:",
"        </strong>",
"        Epirubicin is associated with dose-dependent cardiomyopathy, the incidence of which is related to cumulative dose. Assess baseline LVEF prior to initiating therapy. Epirubicin is contraindicated for patients with recent myocardial infarction, severe myocardial dysfunction, severe arrhythmias, or prior treatment with maximum cumulative doses of anthracyclines. In the original protocol, patients were excluded from receiving epirubicin if their LVEF was below the normal range",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count on day 1 prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess basic metabolic panel including creatinine and liver function tests on day 1 prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for neurotoxicity prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for stomatitis, diarrhea, and palmar-plantar erythrodysesthesiass during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for hearing loss prior to each dose of cisplatin; audiometry as clinically indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor cumulative epirubicin dose. Reassess LVEF periodically as clinically indicated. Refer to UpToDate topic on \"Cardiotoxicity of anthracycline-like chemotherapy agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        Hold epirubicin until the platelets are &ge;100,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        and the absolute neutrophil count is &ge;1500 cells/mm",
"        <sup>",
"         3[4]",
"        </sup>",
"        . In the original ECX protocol, cisplatin and epirubicin doses were delayed by one week or until myelosuppression was resolved if the platelet count was &lt;100,000/microL or the total white blood cell count was &lt;2000 cells/microL on day 1",
"        <sup>",
"         [2]",
"        </sup>",
"        . The dose of epirubicin was reduced by 25 percent for a second episode of treatment delay due to myelosuppression or for febrile neutropenia. There were no dose reductions for capecitabine based on blood counts.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Renal dysfunction:",
"        </strong>",
"        Hold cisplatin until serum creatinine &lt;1.5 mg/dL and/or blood urea nitrogen &lt;25 mg/dL",
"        <sup>",
"         [5]",
"        </sup>",
"        . In the original trial of ECX, full dose cisplatin was given if the estimated GFR was &gt;60 mL/min, and the drug was held if the estimated GFR was &lt;40 mL/min",
"        <sup>",
"         [2]",
"        </sup>",
"        . For an estimated GFR of 40 to 60 mL/min, the dose of cisplatin (in mg) was equivalent to the estimated GFR (in mL/min).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Mucositis, diarrhea, nausea and vomiting:",
"        </strong>",
"        In the original trial of ECX, capecitabine was stopped for grade 2 to 3 stomatitis, diarrhea, or nausea and vomiting",
"        <sup>",
"         [2]",
"        </sup>",
"        . If grade 3 toxicity was controlled adequately within two days and after resolution of any grade 2 toxicity, capecitabine was continued at full dose. If grade 2 toxicity occurred a second time, the dose was reduced by 25 percent; a third time, by 50 percent, and if it occurred a fourth time, treatment was discontinued. If grade 3 toxicity took longer than two days to resolve, the capecitabine dose for the next cycle was reduced by 25 percent; if grade 3 toxicity recurred, the dose was reduced by 50 percent, and if it recurred, the drug was discontinued. For grade 4 mucositis, diarrhea, or nausea or vomiting, the drug was either discontinued or the dose reduced by 50 percent. Doses of capecitabine that are omitted for toxicity are not replaced or restored. Instead, the patient should resume the planned treatment cycles at the modified dose",
"        <sup>",
"         [3]",
"        </sup>",
"        .",
"        <strong>",
"         NOTE:",
"        </strong>",
"        Severe diarrhea, mucositis, and myelosuppression after capecitabine should prompt evaluation for dihydropyrimidine dehydrogenase deficiency. Refer to UpToDate topic on \"Enterotoxicity of chemotherapeutic agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neurotoxicity:",
"        </strong>",
"        Neuropathy usually is seen with cumulative doses of cisplatin &gt;400 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        , although there is marked interindividual variation. Patients with mild neuropathy can continue to receive full cisplatin doses. If neuropathy interferes with function, the risk of potentially disabling neurotoxicity must be weighed against the benefit of continued treatment. Refer to UpToDate topic on \"Neurologic complications of platinum-based chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Palmar-plantar erythrodysesthesias:",
"        </strong>",
"        In the original trial, capecitabine was withheld for grade 2 or worse palmar-plantar erythrodysesthesias until resolution and the subsequent doses reduced by 15 percent for grade 2, 30 percent for grade 3, and 50 percent for grade 4 toxicity",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topic on \"Cutaneous complications of conventional chemotherapy agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Other toxicity:",
"        </strong>",
"        Hold epirubicin until all non-hematologic toxicity resolved to &le; grade 1",
"        <sup>",
"         [4]",
"        </sup>",
"        . Reduce epirubicin dose by 25 percent for any grade 3/4 non-hematologic toxicity in previous cycles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; GFR: glomerular filtration rate; LVEF: left ventricular ejection fraction; CBC: complete blood count.",
"     <br/>",
"     * Diluent solutions should not be modified without consulting a detailed reference due to potential incompatibility(ies).",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Cunningham D, et al. N Engl J Med 2008; 358:36.",
"      </li>",
"      <li>",
"       Sumpter K, et al. Br J Cancer 2005; 92:1976.",
"      </li>",
"      <li>",
"       Capecitabine. FDA-approved manufacturer's product information. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 6, 2011).",
"      </li>",
"      <li>",
"       Epirubicin hydrochloride injection. FDA-approved manufacturer's product information. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 6, 2011).",
"      </li>",
"      <li>",
"       Platinol (cisplatin) injection. FDA-approved manufacturer's product information. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on December 6, 2011).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
